import { FaNpm } from "react-icons/fa";
import NavBar from "../NavBar";

const Notfound = () => {
  return (
    <>
      <NavBar />
      <center>
        <h2 style={{ color: "RED" }}>ERROR!!! 404 NOT FOUND!!!</h2>
      </center>
    </>
  );
};
export default Notfound;
